import './App.css';
import React from "react";
import Header from "./components/prototype/Header";
import "bootstrap/dist/css/bootstrap.css"
import {BrowserRouter} from "react-router-dom";
import {Route, Routes} from "react-router";
import Facility from "./components/model/facility/Facility";
import {Footer} from "./components/prototype/Footer";
import FacilityCreate from "./components/model/facility/FacilityCreate";

function App() {
    return (
        <div className="container-fluid">
            <Header/>
            <Routes>
                <Route path="/facility" element={<Facility/>}></Route>
                <Route path="/facility/create" element={<FacilityCreate/>}></Route>
            </Routes>
            <Footer/>
        </div>
    );
}

export default App;
